import React from "react";
import { useState } from "react";
import "./index.css";



const App = () => {
  const [name, setName] = useState("");

  const onEvents = (gogo) => {
    setName(gogo.target.value)
  }
  return (
    <div className="heading">
      <h1>Helle {name}</h1>
      <input type="text"
        placeholder="Enter Your Name"
        onChange={onEvents}
      />
      <button>Submit</button>
    </div>
  )
}
export default App;
